import React, { useState } from 'react';
import axios from 'axios';

const PresignedUrl = () => {
    const [fileName, setFileName] = useState('');
    const [url, setUrl] = useState('');

    const handleGetUrl = async () => {
        try {
            const response = await axios.get(`http://localhost:8080/api/s3/presigned-url/${fileName}`);
            setUrl(response.data);
        } catch (error) {
            console.error("Failed to get presigned URL.");
        }
    };

    return (
        <div>
            <h2>Get Presigned URL</h2>
            <input
                type="text"
                placeholder="Enter file name"
                value={fileName}
                onChange={(e) => setFileName(e.target.value)}
            />
            <button onClick={handleGetUrl}>Get URL</button>
            {url && <p>Presigned URL: <a href={url} target="_blank" rel="noopener noreferrer">{url}</a></p>}
        </div>
    );
};

export default PresignedUrl;
